import React from 'react'
import classnames from 'classnames'

const ToggleFilter = () =>{
    const filter = false
    return(
        <div className="row">
        <div className={classnames('col-md-6 text-center task-filter')} onClick={ filter = !filter }>Incomplete Tasks</div>
        <div className={classnames('col-md-6 text-center task-filter')} onClick={filter = !filter}>Completed Tasks </div>
      </div>
    )
}

export default ToggleFilter
